import React, { useState } from 'react';

const App4 = () => {
    let newTime = new Date().toLocaleTimeString();
    let [anotherTime, setnewTime] = useState(newTime);

    const NewTime = () => {
        
        
        let anotherTime = new Date().toLocaleTimeString();
        setnewTime(anotherTime);
        
    }
    return (
        <>
            
            <h1>{anotherTime} Time</h1>
            <button onClick={NewTime}>Get Time</button>
            </>
    );
}

export { App4 };
